      super(props);
      this.state = {value: ''};

      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
      this.handleSubmitE = this.handleSubmitE.bind(this);
      
  	}

    handleChange(event) {
    		this.setState({value: event.target.value.toUpperCase()});
	  }

