    	alert('Esta seguro de ingresar con: ' + this.state.value);
    	event.preventDefault();
  	}
    handleSubmitE(event) {
      alert('Esta seguro de Salir: ' + this.state.value);
      event.preventDefault();
    }
  
  render() {

    return (
      <div className="Registry">
         <form onSubmit={this.handleSubmit}>
        <label className =".btn-blue">
          IS : 
          <input placeholder="Ingresa tu IS" ref={input => {this.textInput=input;}}
          type="text" value={this.state.value} onChange={this.handleChange} />
        </label>
        <input type="submit" value="Ingresar"  onClik={this.newIs}/>
        <div>
        
        
        <button className="button .btn-blue" onSubmit={this.handleSubmitE} onClick={this.props.onhide}>Salir</button>

        </div>
      </form>
      </div>
      

      
    );
  }
}
export default Button;
